import React from "react";
import { slide as Menu } from 'react-burger-menu'
import ImageChange from "./ImageChange";

class Example extends React.Component {

  render () {
    return (
      <Menu>
        <ImageChange />
      </Menu>
    );
  }
}

export default Menu;
